import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCartShopping, faMagnifyingGlass, faBell, faUser, faBars } from '@fortawesome/free-solid-svg-icons';

function Navbar() {
  const iconStyle1 = {
    color: '#0d0d0d',
  };

  const iconStyle2 = {
    color: '#030407',
  };

  const iconStyle3 = {
    color: '#020203',
  };

  const iconStyle4 = {
    color: '#040506',
  };

  return (
      <div>
        <div className="navbar__s1">
          <h1 className="navbar__s1__title">Udemy</h1>
        </div>
        <div className="navbar__s2">
          <FontAwesomeIcon icon={faCartShopping} style={iconStyle2} />
          <FontAwesomeIcon icon={faMagnifyingGlass} style={iconStyle1} />
          <input
            type="text"
            placeholder="search for anything here. Tech, Business, Art ... "
          ></input>
        </div>
        <div className="navbar__s3">
          <p>Courses</p>
          <div className="mylearning">
            <p>My Learning</p>
            <div className="mylearning__popup">
              <p>You did not purchase anything yet</p>
            </div>
          </div>
          <FontAwesomeIcon icon={faCartShopping} style={iconStyle2} />
          <FontAwesomeIcon icon={faBell} style={iconStyle3} />
          <FontAwesomeIcon icon={faUser} style={iconStyle4} />
        </div>
        <div className="navbar__s4">
          <i className="fa fa-bars" aria-hidden="true"></i>
        </div>
      </div>
  );
}

export default Navbar;
